import React from 'react';
import './Navbar.css';

const navbar = (props) =>{

  return(
      <nav className="navbar--content">
        <div className={props.optionChosen === 'Pve' ? 'navbar--item navbar--item-active' :'navbar--item' } onClick={() => props.clicked('Pve')}>
          <i className="fas fa-globe-europe fa-2x"></i>PvE
        </div>
        <div className={props.optionChosen === 'Fractals' ? 'navbar--item navbar--item-active' :'navbar--item' } onClick={() => props.clicked('Fractals')}>
          <i className="fas fa-dungeon fa-2x"></i>Fractals
        </div>
        <div className={props.optionChosen === 'WvW' ? 'navbar--item navbar--item-active' :'navbar--item' }>
          <i className="fas fa-chess-rook fa-2x"></i>WvW
        </div>
        <div className={props.optionChosen === 'Search' ? 'navbar--item navbar--item-active' :'navbar--item' }>
          <i className="fas fa-search fa-2x"></i>
        </div>
      </nav>
  );
}

export default navbar;
